import React from "react";
import { HealmeLogo } from "../../../constants/constants";
import { DocPic } from "../../../constants/constants";
import './_doc-select.css';
import Cookies from "js-cookie";

const Doc_select:React.FC = () => {

    const handleDoctorButtonClick = () => {
        window.location.href = '/confirm-appointment'; // place whatever site you want to navigate to 
      };
      var newDiv = document.createElement('div');

      // Set some content or attributes for the <div> (optional)
      newDiv.textContent = 'This is a dynamically created <div> element.';
      

    return (
        <div className="home-page-container">
            <div className="header-container">
                <div className="logo-container">
                    <img className="logo-img" src={ HealmeLogo } alt="Logo" />
                </div>
            </div>
            <div>
                listing {Cookies.get('doctype')}
            </div>
            <div className="body-container">
                <div className="doctor-confirm-panel" id='list'>
                    <div className="doc-photo">
                         <img className="doc" src= { DocPic } alt="Pic of the doctor" />
                    </div>
                    <div className="appointment-description">
                        <div>
                            Dr. Anita Priyamouli
                        </div>
                        <div>  
                            Consultant - Dental Surgery BDS 
                        </div>
                    </div>
                    <button type="button" className="doctor-btn" onClick={handleDoctorButtonClick}>
                        Book An Appointment
                    </button>
                </div>
            </div>
            {/* <div className="bottom-border">
            </div>
            <div className="copyrights-text">Â©HEALME TECHNOLOGIES</div> */}
        </div>
    )
}

export default Doc_select;
